import React, { useState } from 'react';
import LaundererItem from './LaundererItem';

const LaundererListModal = () => {
  const [launderers, setLaunderers] = useState([
    {
      id: 1,
      firstName: 'Keith',
      lastName: 'Russel',
    },
    {
      id: 2,
      firstName: 'Sam',
      lastName: 'Smith',
    },
  ]);
  return (
    <div id='launderer-list-modal' class='modal'>
      <div className='modal-content'>
        {launderers.length === 0 ? (
          <p>No Launderer to show</p>
        ) : (
          launderers.map((launderer) => (
            <LaundererItem key={launderer.id} launderer={launderer} />
          ))
        )}
      </div>
    </div>
  );
};

export default LaundererListModal;
